description:
Verenigde Staten
Thriller
85 minuten

geregisseerd door Mukunda Michael Dewil
met Paul Walker, Kate Tilley en Gys de Villiers

Een onlangs voorwaardelijk vrijgelaten man krijgt per ongeluk de verkeerde auto mee bij een verhuurbedrijf. In de auto ontdekt hij belangrijk bewijsmateriaal van een rechtszaak betreffende een corruptie schandaal. Nadat hij er ingeluisd wordt door een corrupte agent (Paul Walker) moet hij een hele politiemacht zien te omzeilen in een stad die hij niet kent. Zal hij het bewijsmateriaal op tijd bij de aanklager kunnen krijgen en zo zijn eigen naam zuiveren?



